import React from "react";
import styled from "styled-components";

import PageLayout from "./PageLayout";
// mui
import Grid from "@mui/material/Grid";

const Calculator = () => {
  return (
    <PageLayout>
      <Grid container spacing={2}>
        <Grid item xs={12}></Grid>
        {/*  */}
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>CE</StyledBtn>
        </StyledBtnWrapper>
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>{"("}</StyledBtn>
        </StyledBtnWrapper>
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>{")"}</StyledBtn>
        </StyledBtnWrapper>
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>X</StyledBtn>
        </StyledBtnWrapper>
        {/*  */}
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>7</StyledBtn>
        </StyledBtnWrapper>
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>8</StyledBtn>
        </StyledBtnWrapper>
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>9</StyledBtn>
        </StyledBtnWrapper>
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>/</StyledBtn>
        </StyledBtnWrapper>
        {/*  */}
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>4</StyledBtn>
        </StyledBtnWrapper>
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>5</StyledBtn>
        </StyledBtnWrapper>
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>6</StyledBtn>
        </StyledBtnWrapper>
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>-</StyledBtn>
        </StyledBtnWrapper>
        {/*  */}
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>1</StyledBtn>
        </StyledBtnWrapper>
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>2</StyledBtn>
        </StyledBtnWrapper>
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>3</StyledBtn>
        </StyledBtnWrapper>
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>+</StyledBtn>
        </StyledBtnWrapper>
        {/*  */}
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>.</StyledBtn>
        </StyledBtnWrapper>
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>0</StyledBtn>
        </StyledBtnWrapper>
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>3</StyledBtn>
        </StyledBtnWrapper>
        <StyledBtnWrapper item xs={3}>
          <StyledBtn>=</StyledBtn>
        </StyledBtnWrapper>
      </Grid>
    </PageLayout>
  );
};

const Input = styled.input`
  background-color: red;
`;

const StyledBtnWrapper = styled(Grid)`
  width: 100px;
  height: 75px;
`;

const StyledBtn = styled.button`
  width: 100%;
  height: 100%;
  border: 1px solid grey;
  cursor: pointer;
  border-radius: 4px;
  background-color: white;
  box-shadow: rgba(0, 0, 0, 0.1) 0px 10px 15px -3px, rgba(0, 0, 0, 0.05) 0px 4px 6px -2px;
`;

export default Calculator;
